import Test from "./components/TestComponent";
function App() {
  clickedMessage
  return (
    <div>
      <h1>Hello!</h1>
      <p>This is a paragraph.</p>
      <img
        src="http://pages.cpsc.ucalgary.ca/~carey/CPSC441/ass1/Floppy.jpg"
        alt="My boy Floppy"
        width="200"
        height="300"
        onClick={console.log("Image was clicked!")}
      />
      <p>Here is a test component:</p>
      <Test name="Carter" />
      <p>Here it is again:</p>
      <Test name="Not Carter" />
    </div>
  );
}

export default App;
